export default (() =>{
    return(
        <section className={styles.projects_container}>

            <h1>Projetos</h1>
            
            <div className={styles.pojects_slider}>
                <div className={styles.projects_slides}>
                    <input type='radio' name=''/>

                </div>
            </div>

        </section>
    )
})
